	(35, 20, 'ifso_trigger_rules', '[{"trigger_type":"Geolocation","testing-mode":"","freeze-mode":"","geolocation_data":"COUNTRY!!United States!!US","geolocation_behaviour":"is","recurrence_option":"","recurrence_custom_units":"","recurrence_custom_value":"","recurrence-override":false,"add_to_group":null,"remove_from_group":null,"views":false,"bounce":false,"conversion":false},{"trigger_type":"Geolocation","testing-mode":"","freeze-mode":"","geolocation_data":"COUNTRY!!India!!IN","geolocation_behaviour":"is","recurrence_option":"","recurrence_custom_units":"","recurrence_custom_value":"","recurrence-override":false,"add_to_group":null,"remove_from_group":null,"views":false,"bounce":false,"conversion":false}]'),
	(54, 20, 'ifso_trigger_version', '<p class="sortDec"><strong>Content is for USA.<br /></strong><br />Australia completed the formalities but they had essentially won the game between overs 11 to 50 of the Indian innings, where they conceded just 4 boundaries.</p>\r\n<div class="storyDetails">\r\n<div class="detail ">\r\n<div class="storyParagraphFigure">\r\n<p>It may not have been a 5/3 type of a collapse, but a capitulation of sorts nonetheless. As the entire nation plunges into <a href="https://www.hindustantimes.com/cricket/travis-heads-majestic-century-sinks-indian-hearts-as-australia-cruise-to-record-extending-sixth-world-cup-title-101700406802897.html" target="_blank" rel="noopener">disappointment, heartbreak, sombreness</a> and collective grief following <a href="https://www.hindustantimes.com/cricket/india-vs-australia-live-score-icc-world-cup-final-2023-today-19-november-ind-vs-aus-odi-narendra-modi-stadium-ahmedabad-101700363947548.html" target="_blank" rel="noopener">India\'s defeat</a> in the final of the <a href="https://www.hindustantimes.com/cricket/world-cup" target="_blank" rel="noopener">World Cup</a>, scribes, including yours truly, will dwell into reasons behind this outcome. Was it the toss? Conditions? Dew? <a href="https://www.hindustantimes.com/cricket/watch-travis-head-kapil-dev-catch-rohit-sharma-rampage-becomes-turning-point-world-cup-final-india-vs-australia-101700385811674.html" target="_blank" rel="noopener">Rohit Sharma\'s shot</a>? <a href="https://www.hindustantimes.com/cricket/watch-virat-kohli-shell-shocked-pat-cummins-anushka-distraught-aus-captain-ahmedabad-funereal-silence-world-cup-final-101700390682704.html" target="_blank" rel="noopener">Virat Kohli\'s dismissal</a>? Or <a href="https://www.hindustantimes.com/cricket/players/kl-rahul-60122" target="_blank" rel="noopener">KL Rahul</a>\'s? No, the answer is primarily two numbers. Only four boundaries were scored in the final 40 overs of India\'s innings. And frankly, that right there marked the biggest point of no return.</p>\r\n<p>Here\'s some trivia around it. Let this sink in. Of those four boundaries, Mohammed Shami and Mohammed Siraj hit two. It is the joint-fewest by India in a completed innings since July 2011. The last time they hit fewer boundaries after the 10th over of an ODI innings when they batted at least 40 overs in total was in 1999. There was no coming back. This may not exactly fall in the timid or the fearful category but it certainly wasn\'t the bravest either. After Pat Cummins won the toss and opted to bowl, <a href="https://www.hindustantimes.com/cricket/players/rohit-sharma-3852" target="_blank" rel="noopener">Rohit</a> knew it was advantage Australia, and that his \'we were looking to bat first\' was nothing more than just a cover up. Simply put, the pitch behaved in three different ways throughout the contest. To put it into further perspective, it was as if India\'s innings began on a Day 3 Nagpur surface, ended on Day 5 approximately five hours later and then transformed into a whole other Day 1 Adelaide pitch when Australia batted.</p>\r\n</div>\r\n</div>\r\n</div>'),
