	(13, 1, '2023-11-20 06:22:58', '2023-11-20 06:22:58', '<!-- wp:ifso/ifso-block {"selected":20} /-->\n\n<p>It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout. The point of using Lorem Ipsum is that it has a more-or-less normal distribution of letters, as opposed to using \'Content here, content here\', making it look like readable English. Many desktop publishing packages and web page editors now use Lorem Ipsum as their default model text, and a search for \'lorem ipsum\' will uncover many web sites still in their infancy. Various versions have evolved over the years, sometimes by accident, sometimes on purpose (injected humour and the like).</p>\n<p><img class="alignnone size-full wp-image-10" src="http://localhost/wordpress/wp-content/uploads/2023/11/top-banner-2.jpg" alt="" width="333" height="235" /></p>\n<p>It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout. The point of using Lorem Ipsum is that it has a more-or-less normal distribution of letters, as opposed to using \'Content here, content here\', making it look like readable English. Many desktop publishing packages and web page editors now use Lorem Ipsum as their default model text, and a search for \'lorem ipsum\' will uncover many web sites still in their infancy. Various versions have evolved over the years, sometimes by accident, sometimes on purpose (injected humour and the like).</p>\n<p> </p>', 'Why do we use it?', '', 'publish', 'open', 'open', '', 'why-do-we-use-it', '', '', '2023-11-20 08:46:29', '2023-11-20 08:46:29', '', 0, 'http://localhost/wordpress/?p=13', 0, 'post', '', 0),
